import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import 'tachyons'

const Admin = {
    marginLeft: 30,
    color : "Black"
}

const Admin1 = {
  color: "Black"
};

const Admin2 = {
  color: "Black"
};


class AdminPage extends Component 
{
    render()
    {
        return (
          <div className="">
            <div className="dib col-xl-3 col-sm-6 mb-5 grow" >
              <Link to="#">
                <div className="bg-white rounded shadow-sm py-5 px-4 tc">
                  <h1 className="mb-0" style={Admin}>
                    Brain Tumor
                  </h1>
                </div>
              </Link>
            </div>
            <div className="dib col-xl-3 col-sm-6 mb-5 grow">
              <Link to="#">
                <div className="bg-white rounded shadow-sm py-5 px-4 tc">
                  <h1 className="mb-0" style={Admin1}>
                    Breast Cancer
                  </h1>
                </div>
              </Link>
            </div>
            <div className="dib col-xl-3 col-sm-6 mb-5 grow">
              <Link to="#">
                <div className="bg-white rounded shadow-sm py-5 px-4 tc">
                  <h1 className="mb-0" style={Admin2}>
                    Tuberculosis
                  </h1>
                </div>
              </Link>
            </div>
          </div>
        );
    }
}

export default AdminPage;
